export const getCategoryId = (categoryPath: string[]) => {
  const pathStr = categoryPath.join(" > ");
  const categoryId = leafs.get(pathStr);
  if (categoryId) {
    return categoryId;
  }
  throw new Error(`Category does not exist.\n ${pathStr}`);
};
